//发送邮件
import UIKit
import MessageUI

class ViewController: UIViewController ,UINavigationControllerDelegate,
MFMailComposeViewControllerDelegate{

    override func viewDidLoad() {
        super.viewDidLoad()

        //首先要判断设备具不具备发送邮件功能
        if MFMailComposeViewController.canSendMail(){
            let controller = MFMailComposeViewController()
            //设置代理
            controller.mailComposeDelegate = self
            //设置主题
            controller.setSubject("我是邮件标题")
            //设置收件人
            controller.setToRecipients(["a1@hangge.com","a2@hangge.com"])
            //设置抄送人
            controller.setCcRecipients(["b1@hangge.com","b2@hangge.com"])
            //设置密送人
            controller.setBccRecipients(["c1@hangge.com","c2@hangge.com"])

            //添加图片附件
            let path = NSBundle.mainBundle().pathForResource("hangge.png", ofType: "")
            let myData = NSData(contentsOfFile: path!)
            controller.addAttachmentData(myData!, mimeType: "image/png", fileName: "swift.png")

            //设置邮件正文内容（支持html）
            controller.setMessageBody("我是邮件正文", isHTML: false)

            //打开界面
            self.presentViewController(controller, animated: true, completion: nil)
        }else{
            print("本设备不能发送邮件")
        }
    }

    //发送邮件代理方法
    func mailComposeController(controller: MFMailComposeViewController,
                               didFinishWithResult result: MFMailComposeResult, error: NSError?) {
        controller.dismissViewControllerAnimated(true, completion: nil)

        switch result{
        case MFMailComposeResultSent:
            print("邮件已发送")
        case MFMailComposeResultCancelled:
            print("邮件已取消")
        case MFMailComposeResultSaved:
            print("邮件已保存")
        case MFMailComposeResultFailed:
            print("邮件发送失败")
        default:
            print("邮件没有发送")
            break
        }
    }

    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
    }
}

import UIKit
import MessageUI

class ViewController: UIViewController ,UINavigationControllerDelegate,
MFMessageComposeViewControllerDelegate{

    override func viewDidLoad() {
        super.viewDidLoad()
        // Do any additional setup after loading the view, typically from a nib.

        //首先要判断设备具不具备发送短信功能
        if MFMessageComposeViewController.canSendText(){
            let controller = MFMessageComposeViewController()
            //设置短信内容
            controller.body = "短信内容：欢迎来到hangge.com"
            //设置收件人列表
            controller.recipients = ["123456","120000"]
            //设置代理
            controller.messageComposeDelegate = self
            //打开界面
            self.presentViewController(controller, animated: true, completion: { () -> Void in

            })
        }else{
            println("本设备不能发送短信")
        }
    }

    //发送短信代理
    func messageComposeViewController(controller: MFMessageComposeViewController!,
        didFinishWithResult result: MessageComposeResult) {
        controller.dismissViewControllerAnimated(true, completion: nil)
        switch result.value{
            case MessageComposeResultSent.value:
                println("短信已发送")
            case MessageComposeResultCancelled.value:
                println("短信取消发送")
            case MessageComposeResultFailed.value:
                println("短信发送失败")
            default:
                break
        }
    }

    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
    }
}

